import PopularRestaurant from './popular-restaurants/PopularRestaurant';
import './HomePage.scss';
import claro from '../../assets/claro.png';
import lumina from '../../assets/mizlala-gret-mullet-fillet.png';
import tiger from '../../assets/screen-shot-2019-01-06-at-10-57-26.png'; 

const DUMMY_DATA = [
    {
      id: 'm1',
      image: claro,
      name: 'Claro',
      chef: 'Ran Shmueli',
      signature: '',
      description: '',
      icon: '',
      price: ''
    },
    {
      id: 'm2',
      image: lumina,
      name: 'Lumina',
      chef: 'Meir Adoni'
    },
    {
      id: 'm3',
      image: tiger,
      name: 'Tiger Lilly',
      chef: 'Yanir Green'
    }
  ];


  const DummyData= () => {
      const popularList= DUMMY_DATA.map((restaurant) => (<PopularRestaurant key={restaurant.id} name={restaurant.name} chef={restaurant.chef} image={restaurant.image} />));
      return(
          <div className='popular-container'>
             {popularList}
          </div>
      )
  }
  export default DummyData;
